
var app = require('../app');
var chai = require('chai'),
 chaiHttp = require('chai-http');
chai.use(chaiHttp);
var request = require('supertest');
var expect = chai.expect;

//admin login api

    describe("Get Admin Data", function() {
        this.timeout(15000);        
        it("get The Admin Login", function(done) {
            this.timeout(15000);            
            // Send some Form Data
            
             request(app)
            .post('/zrm/api/adminlogin')
            .send({ emailid: "admin@zymr.com",
                        password: "password",
                        token : "" })
            .end(function(err, res) {
                console.log('--------admin list',res.body.data);
                if (err) done(err);
                expect(res).to.have.status(200);
                expect(res).to.be.json;
                expect(res.body).to.be.an('object');
                expect(res.body.data.emailid).to.be.equal("admin@zymr.com");           
                  done();
            });
            
            
        });

    });

